import React from "react";
import "./style.css";


const employees = [
    {
    image: "",
    name: "Chris",
    phone: 215-368-5444,
    email: "Chris@chris.com",
    dob: "10/12/21"
    }
]

export const Row  = props => 
<>
<tr>
<td>{props.image}</td>
<td>{props.name}</td>
<td>{props.phone}</td>
<td>{props.email}</td>
<td>{props.dob}</td>
</tr>
</>


function EmployeeTable(props) {
  return (
    <table>
        <tr>
          <th>Image</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {props.employees.map(person => (
            <Row {...person}/>
        ))}

    </table>
  );
}

export default EmployeeTable;
